import { useEffect, useState } from "react";
import axios from "axios";

function FetchApi2() {
  const [names, setNames] = useState([]); // Changed to `names` for consistency

  async function fetchApiMethod() {
    try {
      const response = await axios.get("https://reqres.in/api/users?page=2");
      const arrayElement = response.data.data;
      setNames(arrayElement.map((element) => element.first_name));
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  }

  useEffect(() => {
    fetchApiMethod();
  }, []);

  return (
    <>
      <p>Fetch API 2</p>
      <p>
        {names.length > 0 ? (
          names.map((name, index) => (
            <span key={index}>{name} </span>
          ))
        ) : (
          <span>No names available</span>
        )}
      </p>
    </>
  );
}

export default FetchApi2;
